class Solution(object):
    def threeSum(self, nums):
        """
        :type nums: List[int]
        :rtype: List[List[int]]
        """
        result = []
        for i in range(len(nums)):
            two_sum = self.twoSum(nums[i + 1:], -nums[i])
            if two_sum:
                result.append([nums[i], two_sum[0], two_sum[1]])
        return result

    def twoSum(self, nums1, target):
        comp = set()
        for i in range(len(nums1)):

            if target - nums1[i] in comp:
                return nums1[i], target - nums1[i]
            comp.add(nums1[i])
        return False

    def threeSum2(self, nums):
        res = []
        nums.sort()
        length = len(nums)
        for i in range(length - 2):  # [8]
            if nums[i] > 0: break  # [7]
            if i > 0 and nums[i] == nums[i - 1]: continue  # [1]

            l, r = i + 1, length - 1  # [2]
            while l < r:
                total = nums[i] + nums[l] + nums[r]

                if total < 0:  # [3]
                    l += 1
                elif total > 0:  # [4]
                    r -= 1
                else:  # [5]
                    res.append([nums[i], nums[l], nums[r]])
                    while l < r and nums[l] == nums[l + 1]:  # [6]
                        l += 1
                    while l < r and nums[r] == nums[r - 1]:  # [6]
                        r -= 1
                    l += 1
                    r -= 1
        return res


