def minimumBribes(q):
    count = 0
    for i in range(len(q)):
        pos_diff = (q[i]-1) - i
        if pos_diff > 2:
            print("Too chaotic")
            return
        elif pos_diff > 0:
                count += pos_diff
    print(count)


