class Node:
    def __init__(self, data):
        self.data = data
        self.next = self.prev = None


def sortedInsert(head, data):
    new = Node(data)
    if not head:
        head = new
        return head

    if head.data >= data:
        new.next = head
        head.prev = new
        head = new
        return head

    current = head
    while current.next and current.next.data < data:
        current = current.next

    if not current.next:
        current.next = new
        new.prev = current
        return head

    temp = current.next
    current.next = new
    new.prev = current
    new.next = temp
    temp.prev = new

    return head


def reverse(head):
    current = None
    while head:
        current = head
        nxt = head.next
        head.next = head.prev
        head.prev= nxt
        head = nxt
    return current


