def solution(A):
    # write your code in Python 3.6
    largest = 0
    second_largest = 0
    for num in A:
        if num > second_largest:
            if num > largest:
                second_largest = largest
                largest = num
            else:
                second_largest = num

    if largest > 0:
        if second_largest > 0:
            if largest - second_largest > 1:
                return second_largest + 1
            else:
                return largest + 1
        else:
            if largest == 1:
                return 2
            else:
                return 1
    else:
        return 1


def solution(A):
    # write your code in Python 3.6
    A.sort()
    prev = 0
    for num in A:
        if num > 0:
            if num - prev > 1:
                continue
            else:
                prev = num

    return prev + 1


