def timeConversion(s):
    #
    # Write your code here.
    #
    hr = ''
    am_pm = ''
    res = ''
    size = len(s)
    for i in range(size):
        if i == 0 or i == 1:
            hr += s[i]
        elif i == size-1 or i == size-2:
            am_pm += s[i]
        else:
            res += s[i]
    new = int(hr)
    if am_pm.upper() == 'PM':
        if new < 12:
            new += 12
            hr = str(new)
    else:
        if new == 12:
            hr = "00"
    return hr + res


