def fibonacciModified(t1, t2, n):
    fib = [None] * (n+1)
    fib[0] = t1
    fib[1] = t2
    for i in range(2, n+1):
        fib[i] = fib[i-2] + ((fib[i-1])**2)
    return fib[n-1]


